import Card from "./Card.js"
export default function ListPokemon(props){
    fetch("http://localhost:3000/data.json").then((data) => {
        data.json().then((listPokemon) =>{
        listPokemon.foreach(pokemon =>{
            <Card name="{pokemon}"/>
        })
    })
})
    return ""
}
